import axios from "axios";
import React from "react";

function Admin() {
  const [posts, setTable] = React.useState(null);

  React.useEffect(() => {
    axios.post(`${process.env.REACT_APP_API_URL}/tables`).then((response) => {
      setTable(response.data);
    });
  }, []);

  if (!posts) return null;
  return (
    <div>
      <button>Start</button>
    </div>
  );
}
export default Admin;
